INSERT INTO `projects` VALUES (60,5,16,'Custom GpS','Many times you wonder why there is no gps that help you to customize your own route.','San Francisco','','CA','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1456962004/zyf8uprmxygucr4p65j1.jpg','<figure><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457242148/c2ldvypwdaf4lsgnv5fu.jpg\" data-image=\"\"></figure>','Idea','https://res.cloudinary.com/dqpkpmrgk/video/upload/v1457038221/dfcqehlgpgwzkauqd3ja.mov',62,49116,'Jay Ho','','Technology','-2.27374e-13px -472px','dfcqehlgpgwzkauqd3ja','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1456962004/zuh64fghoyiaor1ob5qs.png'),(61,6,3,'Y-3 quasa high','La Qasa High est une montante futuriste, avec un mélange élaboré de matières et une semelle incurvée','Tokyo','','Japan','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457029162/mqcpazbgfuoteyxp3eok.png','','Live project',NULL,76,91204,'Maxence Mson','','Design','0px -419px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457029161/klyolzmpqopkmopw3orz.png'),(62,7,16,'Witty','The creators marketplace','Yonkers','NY','United States','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457017756/kzc9fluwfsny3ftjpybx.jpg','','Drafted project',NULL,59,31389,'Quentin Vrr','','Technology','0px -940.245px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457017755/w8iaowzphrjx4bfuvap8.png'),(63,7,1,'L\'art c\'est beau','','Drancy','','France','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457022044/glneocfigfuhtfqetg2d.png','','Idea','',45,72339,'Quentin Vrr','','Art','0px -387px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457022044/vhrwquilcxzfwkhle98a.png'),(64,4,2,'My project is the best','Hello world','Herblay','','France','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457098308/wgelq730wlptwsniwdb5.png','<h2>DRAGON&nbsp;BALL</h2>\n\n<p><strong class=\"redactor-inline-converted\"><em></em></strong></p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<figure><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457125513/og3q6ieifgeczdj60pcl.jpg\" data-image=\"\"></figure>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p><strong class=\"redactor-inline-converted\"><em><br></em></strong></p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p><strong class=\"redactor-inline-converted\"><em>Dragon Ball</em></strong>&nbsp;&nbsp;(<a href=\"https://en.wikipedia.org/wiki/Japanese_language\">Japanese</a>:&nbsp;ドラゴンボール&nbsp;<a href=\"https://en.wikipedia.org/wiki/Hepburn_romanization\">Hepburn</a>:&nbsp;<em>Doragon Bōru</em><a href=\"https://en.wikipedia.org/wiki/Help:Installing_Japanese_character_sets\">?</a>)&nbsp;is a Japanese&nbsp;<a href=\"https://en.wikipedia.org/wiki/Manga\">manga</a>&nbsp;series written and illustrated by&nbsp;<a href=\"https://en.wikipedia.org/wiki/Akira_Toriyama\">Akira Toriyama</a>. It was originally serialized in&nbsp;<a href=\"https://en.wikipedia.org/wiki/Weekly_Sh%C5%8Dnen_Jump\"><em>Weekly Shōnen Jump</em></a>&nbsp;from 1984 to 1995, with the 519 individual chapters published into 42&nbsp;<a href=\"https://en.wikipedia.org/wiki/Tank%C5%8Dbon\"><em>tankōbon</em></a>&nbsp;volumes by&nbsp;<a href=\"https://en.wikipedia.org/wiki/Shueisha\">Shueisha</a>.<em>Dragon Ball</em>&nbsp;was initially inspired by the classical Chinese novel&nbsp;<a href=\"https://en.wikipedia.org/wiki/Journey_to_the_West\"><em>Journey to the West</em></a>. The series follows the adventures of the protagonist,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Goku\">Goku</a>, from his childhood through adulthood as he trains in martial arts and explores the world in search of the seven orbs known as the Dragon Balls, which summon a wish-granting dragon when gathered. Along his journey, Goku makes several friends and battles a wide variety of villains, many of whom also seek the Dragon Balls.</p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p>The 42&nbsp;<em>tankōbon</em>&nbsp;have been adapted into two&nbsp;<a href=\"https://en.wikipedia.org/wiki/Anime\">anime</a>&nbsp;series produced by&nbsp;<a href=\"https://en.wikipedia.org/wiki/Toei_Animation\">Toei Animation</a>:&nbsp;<a href=\"https://en.wikipedia.org/wiki/Dragon_Ball_(anime)\"><em>Dragon Ball</em></a>&nbsp;and&nbsp;<a href=\"https://en.wikipedia.org/wiki/Dragon_Ball_Z\"><em>Dragon Ball Z</em></a>, which together were broadcast in Japan from 1986 to 1996. Additionally, the studio has developed&nbsp;<a href=\"https://en.wikipedia.org/wiki/List_of_Dragon_Ball_films\">nineteen animated feature films</a>&nbsp;and three television specials, as well as a third anime titled&nbsp;<a href=\"https://en.wikipedia.org/wiki/Dragon_Ball_GT\"><em>Dragon Ball GT</em></a>. Between 2009 and 2015, a revised, faster-paced version of&nbsp;<em>Dragon Ball Z</em>&nbsp;was broadcast under the title&nbsp;<em>Dragon Ball Kai</em>, in which most of the original version\'s footage not featured in the manga is removed. A fifth anime series titled&nbsp;<a href=\"https://en.wikipedia.org/wiki/Dragon_Ball_Super\"><em>Dragon Ball Super</em></a>&nbsp;began airing in Japan on July 5, 2015. Several companies have developed various types of merchandising based on the series leading to a large&nbsp;<a href=\"https://en.wikipedia.org/wiki/Media_franchise\">media franchise</a>&nbsp;that includes films, both animated and live-action, collectible trading card games, numerous action figures, along with&nbsp;<a href=\"https://en.wikipedia.org/wiki/List_of_Dragon_Ball_soundtracks\">several collections of soundtracks</a>&nbsp;and a&nbsp;<a href=\"https://en.wikipedia.org/wiki/List_of_Dragon_Ball_video_games\">large number of video games</a>.&nbsp;</p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<figure><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457125534/ehv9nh7flnwblwpl1h2o.png\" data-image=\"\"></figure>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p><br></p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p>The manga series was licensed for an English-language release in North America by&nbsp;<a href=\"https://en.wikipedia.org/wiki/Viz_Media\">Viz Media</a>, in the United Kingdom by&nbsp;<a href=\"https://en.wikipedia.org/wiki/Gollancz_Manga\">Gollancz Manga</a>, and Australia and New Zealand by&nbsp;<a href=\"https://en.wikipedia.org/wiki/Madman_Entertainment\">Madman Entertainment</a>. The entire anime series was licensed by&nbsp;<a href=\"https://en.wikipedia.org/wiki/Funimation_Entertainment\">Funimation Entertainment</a>&nbsp;for an English-language release in the United States, although the series has not always been dubbed by the same studio. There have been many films of the franchise including the first live-action film adaptation being produced in 1989 in Taiwan. In 2002,&nbsp;<a href=\"https://en.wikipedia.org/wiki/20th_Century_Fox\">20th Century Fox</a>&nbsp;acquired the rights to produce an American-made live-action film titled&nbsp;<a href=\"https://en.wikipedia.org/wiki/Dragonball_Evolution\"><em>Dragonball Evolution</em></a>&nbsp;that was received negatively by critics and fans; the movie was released on April 10, 2009 in the United States.</p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<p>Since its release,&nbsp;<em>Dragon Ball</em>&nbsp;has become one of the most successful manga and anime series of all time. The manga\'s 42 volumes have sold over 156 million copies in Japan and more than 230 million copies worldwide, making it the second&nbsp;<a href=\"https://en.wikipedia.org/wiki/List_of_best-selling_manga\">best-selling manga series</a>&nbsp;in history. Reviewers have praised the art, characterization, and humor of the story. It is widely regarded as one of the greatest manga series ever made, with many&nbsp;<a href=\"https://en.wikipedia.org/wiki/Mangaka\">manga artists</a>&nbsp;such as<a href=\"https://en.wikipedia.org/wiki/Eiichiro_Oda\">Eiichiro Oda</a>&nbsp;(<a href=\"https://en.wikipedia.org/wiki/One_Piece\"><em>One Piece</em></a>),&nbsp;<a href=\"https://en.wikipedia.org/wiki/Masashi_Kishimoto\">Masashi Kishimoto</a>&nbsp;(<a href=\"https://en.wikipedia.org/wiki/Naruto\"><em>Naruto</em></a>),&nbsp;<a href=\"https://en.wikipedia.org/wiki/Tite_Kubo\">Tite Kubo</a>&nbsp;(<a href=\"https://en.wikipedia.org/wiki/Bleach_(manga)\"><em>Bleach</em></a>),&nbsp;<a href=\"https://en.wikipedia.org/wiki/Hiro_Mashima\">Hiro Mashima</a>&nbsp;(<a href=\"https://en.wikipedia.org/wiki/Rave_Master\"><em>Rave Master</em></a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Fairy_Tail\"><em>Fairy Tail</em></a>) and&nbsp;<a href=\"https://en.wikipedia.org/wiki/Kentaro_Yabuki\">Kentaro Yabuki</a>&nbsp;(<a href=\"https://en.wikipedia.org/wiki/Black_Cat_(manga)\"><em>Black Cat</em></a>) citing&nbsp;<em>Dragon Ball</em>&nbsp;as a source of inspiration for their own now popular works. The anime, particularly&nbsp;<em>Dragon Ball Z</em>, is also highly popular in various countries and was arguably one of the most influential in boosting the popularity of Japanese animation in Western culture.</p>','Drafted project','',135,21600,'Patrick Jane','','Craft','0px -149px','blukqp7lg0hwtqsyjgm4','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457098319/k0udhwphdbs4gqs9cqut.png'),(65,4,1,'sdfdsfsd','dfsdfdf','Ffestiniog','','United Kingdom','','','Idea',NULL,2,22265,'Patrick Jane','','Art','','',''),(66,5,1,'One piece','ONE PIECE（ワンピース）\n(Wan Pīsu)','Brazil','IN','United States','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457130706/kwpseoqpkucew9jwewav.png','<figure><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457131284/vxfgfntrbmyv2dg9nqjh.jpg\" data-image=\"\"></figure>\n\n<h1><strong><em><br></em></strong></h1><h1><strong><em>One piece</em></strong></h1>\n\n<p><em><strong>One Piece</strong></em>&nbsp;(<a href=\"https://en.wikipedia.org/wiki/Japanese_language\">Japanese</a>:&nbsp;ワンピース&nbsp;<a href=\"https://en.wikipedia.org/wiki/Hepburn_romanization\">Hepburn</a>:&nbsp;<em>Wan Pīsu</em><sup><a href=\"https://en.wikipedia.org/wiki/Help:Installing_Japanese_character_sets\">?</a></sup>)&nbsp;is a Japanese&nbsp;<a href=\"https://en.wikipedia.org/wiki/Manga\">manga</a>&nbsp;series written and illustrated by&nbsp;<a href=\"https://en.wikipedia.org/wiki/Eiichiro_Oda\">Eiichiro Oda</a>. It has been serialized in&nbsp;<a href=\"https://en.wikipedia.org/wiki/Shueisha\">Shueisha</a>\'s<em><a href=\"https://en.wikipedia.org/wiki/Weekly_Sh%C5%8Dnen_Jump\">Weekly Shōnen Jump</a></em>&nbsp;magazine since July 19, 1997, with the chapters collected into eighty&nbsp;<em><a href=\"https://en.wikipedia.org/wiki/Tank%C5%8Dbon\">tankōbon</a></em>&nbsp;volumes to date.&nbsp;<em>One Piece</em>&nbsp;follows the adventures of&nbsp;<a href=\"https://en.wikipedia.org/wiki/Monkey_D._Luffy\">Monkey D. Luffy</a>, a funny young man whose body gained the properties of rubber after unintentionally eating a Devil Fruit. With his diverse crew of pirates, named the&nbsp;<a href=\"https://en.wikipedia.org/wiki/Straw_Hat_Pirates\">Straw Hat Pirates</a>, Luffy explores the grand line in search of the world\'s ultimate treasure known as \"One Piece\" in order to become the next King of the Pirates.<br>The manga has been adapted into an&nbsp;<a href=\"https://en.wikipedia.org/wiki/Original_video_animation\">original video animation</a>&nbsp;(OVA) produced by&nbsp;<a href=\"https://en.wikipedia.org/wiki/Production_I.G\">Production I.G</a>&nbsp;in 1998, and an&nbsp;<a href=\"https://en.wikipedia.org/wiki/Anime\">anime</a>&nbsp;series produced by&nbsp;<a href=\"https://en.wikipedia.org/wiki/Toei_Animation\">Toei Animation</a>, which began broadcasting in Japan in 1999 and has aired 731 episodes to date. Additionally, Toei has developed thirteen animated feature films, two OVAs, and five television specials. Several companies have developed various types of merchandising such as a trading card game, and a&nbsp;<a href=\"https://en.wikipedia.org/wiki/List_of_One_Piece_video_games\">large number of video games</a>. The manga series was licensed for an English language release in North America & the United Kingdom by&nbsp;<a href=\"https://en.wikipedia.org/wiki/Viz_Media\">Viz Media</a>&nbsp;and in Australia by&nbsp;<a href=\"https://en.wikipedia.org/wiki/Madman_Entertainment\">Madman Entertainment</a>. The anime series was licensed by&nbsp;<a href=\"https://en.wikipedia.org/wiki/4Licensing_Corporation\">4Kids Entertainment</a>&nbsp;for an English-language release in North America, before the license was dropped and subsequently acquired by<a href=\"https://en.wikipedia.org/wiki/Funimation\">Funimation</a>&nbsp;in 2007.<br><em>One Piece</em>&nbsp;has received widespread critical acclaim, primarily for its art, characterization and humor. Several volumes of the manga have broken publishing records, including highest initial print run of any book in Japan. The official website for Eiichiro Oda\'s&nbsp;<em>One Piece</em>&nbsp;manga announced that the manga has set a Guinness World Record for \"the most copies published for the same comic book series by a single author\". As of June 2015, the manga has 320 million copies printed worldwide,<sup><a href=\"https://en.wikipedia.org/wiki/One_Piece#cite_note-1\">[1]</a></sup>making it the&nbsp;<a href=\"https://en.wikipedia.org/wiki/List_of_best-selling_manga\">best-selling manga series</a>&nbsp;in history.</p>\n\n<p><br></p>\n\n<figure><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457131335/dkq6elzd7ir4ega5tibw.png\" data-image=\"\"></figure>\n\n<h3>Overview</h3>\n\n<p>The world of&nbsp;<em>One Piece</em>&nbsp;is populated by humans and numerous other races such as \"<a href=\"https://en.wikipedia.org/wiki/List_of_piscine_and_amphibian_humanoids\">fishmen</a>\" (a race of fish/human hybrid, similar to&nbsp;<a href=\"https://en.wikipedia.org/wiki/Merman\">mermen</a>&nbsp;and&nbsp;<a href=\"https://en.wikipedia.org/wiki/Mermaid\">mermaids</a>), Minkmen (a race of humanoid animals), and&nbsp;<a href=\"https://en.wikipedia.org/wiki/Giant_(mythology)\">giants</a>. It is covered by two vast oceans, which are divided by a massive mountain range called the Red Line&nbsp;(赤い土の大陸（レッドライン）&nbsp;<em>Reddo Rain</em><sup><a href=\"https://en.wikipedia.org/wiki/Help:Installing_Japanese_character_sets\">?</a></sup>), which is also the only continent in the world.<sup><a href=\"https://en.wikipedia.org/wiki/One_Piece#cite_note-2\">[2]</a></sup>&nbsp;The Grand Line&nbsp;(偉大なる航路（グランドライン）&nbsp;<em>Gurando Rain</em>), a sea that runs perpendicular to the Red Line, further divides them into four seas: North Blue&nbsp;(北の海（ノースブルー）&nbsp;<em>Nōsu Burū</em>), East Blue&nbsp;(東の海（イーストブルー）&nbsp;<em>Īsuto Burū</em>), West Blue&nbsp;(西の海（ウェストブルー）&nbsp;<em>Uesuto Burū</em>)&nbsp;and South Blue&nbsp;(南の海（サウスブルー）&nbsp;<em>Sausu Burū</em>).<sup><a href=\"https://en.wikipedia.org/wiki/One_Piece#cite_note-3\">[3]</a></sup>&nbsp;Surrounding the Grand Line are two regions called Calm Belts&nbsp;(凪の帯（カームベルト）<em>kāmu beruto</em>), similar to&nbsp;<a href=\"https://en.wikipedia.org/wiki/Horse_latitudes\">horse latitudes</a>, which experience almost no wind and ocean currents and are breeding ground for huge sea creatures called neptunians&nbsp;(海王類&nbsp;<em>kaiōrui</em>, lit. \"sea kings\"). Because of this, the calm belts are very effective barriers for those trying to enter the Grand Line.<sup><a href=\"https://en.wikipedia.org/wiki/One_Piece#cite_note-4\">[4]</a></sup>&nbsp;However, navy ships, members of an intergovernmental organization known as the World Government, are able to use a sea-prism stone&nbsp;(海楼石&nbsp;<em>kairōseki</em>)&nbsp;to mask their presence from the sea kings and can simply pass through the calm belts. All other ships are forced to take a more dangerous route, going through a mountain at the first intersection of the Grand Line and the Red Line, a canal system known as Reverse Mountain&nbsp;(リヴァース・マウンテン&nbsp;<em>Rivāsu Maunten</em>).<sup><a href=\"https://en.wikipedia.org/wiki/One_Piece#cite_note-5\">[5]</a></sup>&nbsp;Sea water from each of the four seas runs up that mountain and merges at the top to flow down a fifth canal and into the first half of the Grand Line.<sup><a href=\"https://en.wikipedia.org/wiki/One_Piece#cite_note-6\">[6]</a></sup>&nbsp;The second half of the Grand Line, beyond the second intersection with the Red Line, is also known as the New World&nbsp;(新世界&nbsp;<em>Shin Sekai</em>).<sup><a href=\"https://en.wikipedia.org/wiki/One_Piece#cite_note-7\">[7]</a></sup></p>\n\n<figure><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457131232/pikciekg6i8fjy5ve9df.jpg\"></figure>\n\n<p><br></p>','Idea',NULL,21,42750,'San Gohan','','Art','50% 50%','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457130703/wej8ng9nehd9srudrzxj.png'),(67,14,1,'sdfdfdf','dsfdsfdsfdfdsfsdfsdf','Fontenay-aux-Roses','','France','','','Idea',NULL,4,58207,'Olivier Letrouc','','Art','','',''),(68,7,3,'C\'est un beau projet','Vraiment très beau oh oui','Paris','','France','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457109280/ah8l2cnaoe1nzk1nxccs.png','','Drafted project',NULL,15,33131,'Quentin Verriere','','Design','0px -402px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457109280/nueseg8a1sixfyleqlek.png'),(69,4,4,'dewefwef','','City of Westminster','','United Kingdom','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457115597/bmyl2rqpka29afp1napt.png','','Idea','',7,44524,'Patrick Jane','','Fashion','0px -378px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457115604/mgzfmwlikfbdjtceutdr.png'),(70,4,4,'Les miétier de tailleur','','San Francisco','','CA','','<p>C\'est un métier de tailleur, donc ca m\'intéresse beaucoup</p>','Live project',NULL,4,34309,'Patrick Jane','','Fashion','','',''),(71,23,1,'Roger master project','This is a short description','Toulouse','','France','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457174071/mttgi1t3glx1tqnmsuzd.png','<h1><strong class=\"redactor-inline-converted\">Titre</strong></h1>\n\n<hr>\n\n\n\n<p><strong>Corp du text.</strong></p>\n\n\n\n<ul><li><strong>Corp du text.</strong></li><li><strong>Corp du text.</strong></li><li></li><li><strong>Corp du text.</strong></li><li><strong>Corp du text.</strong></li><li></li><li><strong><br></strong></li><li><strong><hr>Corp du text.</strong></li><li></li></ul>','Idea',NULL,25,90164,'Roger Clanget','','Technology','50% 50%','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457174071/rtauszzykwuazusojb3n.png'),(72,23,1,'ezr','','Toulouse',NULL,'France','','','Drafted project',NULL,1,12951,'Roger Clanget','','Art','','',''),(73,21,16,'Pebble','Awesome Smartwatch, No Compromises','San Francisco','','CA','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457182223/wcfckcu45hvmkn43rxsr.png','<h1>High level details</h1>\n\n<p>\n\nWe have two new watches,&nbsp;<strong>Pebble Time</strong>&nbsp;and&nbsp;<strong>Pebble Time Steel</strong>, with a new&nbsp;<strong>timeline interface</strong>.</p>\n\n<p>Pebble Time and Pebble Time Steel feature a new color e-paper display and microphone for responding to notifications.</p>\n\n<p>No compromises on what you love about Pebble: up to 7 days of battery life, water resistance and customizability.</p>\n\n<p>Pebble Time and Pebble Time Steel are fully compatible with all 6,500+ existing Pebble apps and watchfaces.</p>\n\n<p>Pebble Time starts shipping in May. Pebble Time Steel star</p>\n\n<figure><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457182414/r3mjujo4obpkqyobzwso.png\" data-image=\"\"></figure>\n\n<figure><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457182434/novh0knq8gxmiaxvwmxo.jpg\" data-image=\"\"></figure>\n\n<figure><img src=\"http://res.cloudinary.com/dqpkpmrgk/image/upload/v1457182449/cjbd2d1y1yx0xnywlqrj.png\" data-image=\"\"></figure>','Live project',NULL,7,62971,'Jeane Jeruo','','Technology','0px -129px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457182213/plla8d3o9tboftgmkf4b.png'),(74,7,4,'Dior','Habille les femmes depuis 1923','Paris','','France','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457209536/xlhtcsnaczreuzcnxr9i.png','','Idea',NULL,4,53541,'Quentin Verriere','','Fashion','0px -294px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457209537/nczszkas5lieamqjd82p.png'),(75,35,14,'Compteur éléctrique connecté','I would build an awesome connected electric object for every house & every city in the world','Paris','','France','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457292377/z7akejy9vxfffe04rrd0.png','<p>HUMMMMM, I have an idea and i\'m a developer but i need some ingenieur for build this idea with love & share skills between us</p>','Idea',NULL,5,29840,'quentin malguy','','Science','0px -571.25px','','https://res.cloudinary.com/dqpkpmrgk/image/upload/v1457292373/dgdnxxojd08qfuo3n79o.png');
